    true,nt"url": null,nt"notes": "The caring responders at the Veterans Crisis
    Line are specially trained and experienced in helping Veterans of all ages and circumstances.
    Some of the responders are Veterans themselves and understand what Veterans and
    their families and friends have been through and the challenges Veterans of all
    ages and service eras face.rnrnSince its launch in 2007, the Veterans Crisis Line
    has answered more than 1.86 million calls and has initiated the dispatch of emergency
    services to callers in imminent crisis over 50,000 times. In 2009, the Veterans
    Crisis Line added an anonymous online chat service and has engaged in more than
    240,000 chats. In November 2011, the Veterans Crisis Line introduced a text-messaging
    service to provide another way for Veterans to connect with confidential, round-the-clock
    support, and since then has responded to more than 39,000 texts.rnrnIn 2011, the
    National Veterans Suicide Prevention Hotline was renamed the Veterans Crisis Line
    to encourage Veterans and their families and friends to make the call. People who
    know a Veteran best may be the first to recognize emotional distress and reach out
    for support when issues reach a crisis point u2014 and well before a Veteran is
    at risk of suicide.rnrnTo make sure all Veterans and their loved ones are aware
    of the Veterans Crisis Line, VA is coordinating with communities and partners nationwide
    to let Veterans and their loved ones know that support is available whenever, if
    ever, they need it.",nt"license_title": "Creative Commons CCZero",nt"extras":
